import React from 'react'

const Home = () => {
  return (
    
    <div className='homepagewrapper'>
        <div className="formwrapper">
            <img src="/logo192.png" alt="logo" />
            <h4 className='mainlabel'>Paste your RoomId Here </h4>
        </div>
    </div>
    
    
  )
}

export default Home
